import React, { useEffect, useState } from 'react';
import { api } from '../services/api';
import '../styles/UserManagement.css';

function UserManagement({ isAppAdmin }) {
  const [users, setUsers] = useState([]);
  const [newUser, setNewUser] = useState('');
  const [applications, setApplications] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const [usersData, appsData] = await Promise.all([
        api.getUsers(),
        api.getApplications()
      ]);
      setUsers(usersData);
      setApplications(appsData);
      setLoading(false);
    } catch (err) {
      setError('Failed to fetch data');
      setLoading(false);
    }
  };

  const handleAddUser = async () => {
    if (newUser.trim()) {
      try {
        const userData = {
          username: newUser,
          user_type: 'end',
          email: `${newUser.toLowerCase()}@example.com`,
          password: 'temporary_password' // This should be changed by the user
        };
        const newUserData = await api.createUser(userData);
        setUsers([...users, newUserData]);
        setNewUser('');
        setSuccess('User added successfully');
        setTimeout(() => setSuccess(null), 3000);
      } catch (err) {
        setError('Failed to add user');
      }
    }
  };

  const handleAssignApp = async (userId, appId, roleId) => {
    try {
      await api.assignUserToApplication(userId, appId, roleId);
      const updatedUsers = await api.getUsers();
      setUsers(updatedUsers);
      setSuccess('User assigned successfully');
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError('Failed to assign user');
    }
  };

  const handleRemoveAssignment = async (userId, appId) => {
    try {
      await api.removeUserFromApplication(userId, appId);
      const updatedUsers = await api.getUsers();
      setUsers(updatedUsers);
      setSuccess('Assignment removed successfully');
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError('Failed to remove assignment');
    }
  };

  if (loading) return <div className="loading">Loading...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="user-management-container">
      <h3>User Management</h3>
      {success && <div className="success-message">{success}</div>}

      {!isAppAdmin && (
        <div className="add-user-form">
          <input
            type="text"
            value={newUser}
            onChange={(e) => setNewUser(e.target.value)}
            placeholder="Enter new user name"
          />
          <button onClick={handleAddUser}>Add User</button>
        </div>
      )}

      <ul>
        {users.map((user) => (
          <li key={user.user_id}>
            <div className="user-info">
              <span className="user-name">{user.username}</span>
              <div className="user-assignments">
                <strong>Assigned Applications:</strong>
                {user.assignedApps?.length > 0 ? (
                  user.assignedApps.map((assignment, index) => (
                    <div key={index} className="assignment-tag">
                      {assignment.app_name} ({assignment.role_name})
                      <button 
                        className="remove-assignment"
                        onClick={() => handleRemoveAssignment(user.user_id, assignment.app_id)}
                      >
                        ×
                      </button>
                    </div>
                  ))
                ) : (
                  <span className="no-assignments">No applications assigned</span>
                )}
              </div>
            </div>
            <div className="assignment-controls">
              <select
                onChange={(e) => {
                  const [appId, roleId] = e.target.value.split('|');
                  handleAssignApp(user.user_id, appId, roleId);
                  e.target.value = '';
                }}
                defaultValue=""
              >
                <option value="" disabled>Assign to Application</option>
                {applications.map(app => (
                  app.roles?.map(role => (
                    <option 
                      key={`${app.app_id}-${role.role_id}`} 
                      value={`${app.app_id}|${role.role_id}`}
                    >
                      {app.app_name} - {role.role_name}
                    </option>
                  ))
                ))}
              </select>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default UserManagement;
